import React from 'react'
import {Link, NavLink} from 'react-router-dom'

const Feature = () =>  {
    return ( 
      <div className="col-md-2">
        <div className="card mt-5 ">
          <div className="card-body">
            <div className="list-group-flush">
              <a href="#" className="list-group-item list-group-item-action">Group Word</a>
              <a href="#" className="list-group-item list-group-item-action">Abstruse Word</a>
              <a href="#" className="list-group-item list-group-item-action">Flash Card</a>
              <a href="#" className="list-group-item list-group-item-action">Mnemonics</a>
              <a href="#" className="list-group-item list-group-item-action">About</a>
            </div>
          </div>
        </div>
      </div>
    );
}
 
export default Feature;
